import Geocode from "react-geocode";

Geocode.setApiKey("AIzaSyDgsfpxic6s4iKc27-OmT1tgdyfcdTuOVQ");
Geocode.setLanguage("en");
Geocode.setRegion("es");
Geocode.setLocationType("ROOFTOP");
Geocode.enableDebug();

var latitude  = 0;
var longitude = 0;

const determineLatLongFromAddress = async(address) => {
    // Get latitude & longitude from address.
    const response = await Geocode.fromAddress(address).then(
        (response) => {
            const {lat, lng} = response.results[0].geometry.location;
            return lat;
        },
        (error) => {
            console.error(error);
        }
    )
};

// const determineDistanceBetween = (coordinates1, coordinates2)  => { 
//     //TODO 
// };


export default determineLatLongFromAddress;
